i worked today got my check though i get to work all weekend to wooo im so bored lol so i&nbsp; figures id write in here work was sort of fun today tho i was with lauren dusty and candace so it was fun me n lauren goofed&nbsp; around a lot haha then this stupid lady comes in orders a coffee and then says she ordered a iced coffee i was in the back so i didnt know about it then i came out and i made her whatever she needed was nice didnt have any bad attitude and as shes leaving shes like WOW WHAT BAD ATTITUDES HERE! WOW i was like ok.... sweet lol it was retarded and lauren was getting pretty mad about it im just like just forget about it its not like gonna get u fired you didnt do anything lol whatever...

erics at a concert and im sitting on the computer getting ready to work 2morrow at 7 yay but i get to work with lauren and the rest of the crew so its ok.. its just 8 hours lol whatever&nbsp;

so i realized i need some new songs but idk what. eric gets to meet the people at the concert wooo.. lol there weird bands haha alrighty well im gonna find something else to do then sit on here ill probably write again

