then after work eric picked me up and i got to cash my check and stuff so that was good and i went to the pet store to get my brother a few things for his frog tank lol i ended up buying another frog cuz im obsessed now haha now scott has a frog tank and i have 5 betta fish in my room its pretty much a little pet store in my house hah.

i got to go to the lawn fete today that was pretty fun so a lot of people i havent seen in a while so that was fun&nbsp;&nbsp;

i got to play lots of i got it =] which&nbsp;was awesome haha&nbsp;i had a pretty awesome day with eric today =]&nbsp;

alrighty well im super tired so im going to bed bye everyone =]
